import React, { useState } from 'react';
import { View, Text, StyleSheet } from 'react-native';
import { middleData } from '../../utils/constant';

const Middlepage = () => {
    const [data, setData] = useState(middleData)
    return (
        <View style={styles.middleContainer}>
            {
                data.map((text) => (
                    <View>
                        <Text style={styles.textStyle}>{data.page}</Text>
                        <Text style={styles.smallText}>{data.smallText}</Text>
                    </View>
                ))
            }

        </View>
    );
}

const styles = StyleSheet.create({
    middleContainer: {
        padding: '10px',
    },
    textStyle: {
        fontSize: 24,
        color: '#000',
        fontWeight: 600,
    },
    smallText: {
        fontSize: 15,
        fontWeight: 400,
        color: "#808080",
        margin: '10px'
    }
})

export default Middlepage;
